import React from "react";
import Apple from "./Apple";
import Orange from "./Orange";

const fav = "Orange";

const favf = () => {
    if( fav === "Orange"){
        return <Orange />;
    }
    else{
        return <Apple />;
    }
}

function App(){
    return(
        <>
            <h1 className="heading"> Here Are Some Product List </h1>
            <favf />
        </>
    );
};

export default App;
